import { Navbar } from "./components/navbar/Navbar";
import { Routes, Route } from "react-router-dom";
import './App.css';
import { Home } from "../components/home/Home";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Navbar/>} exact/>
        <Route path="/home" element={<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
